      | 50152 -> { ItemTypeData.id= 50152; name= "Erebus Caille Neon SKIN"; published= true; description= "The permanently crowded streets of Caille are lit by uncounted kilometers of neon lighting by night. Indeed, some sections of the cultural capital of the Gallente Federation are so deep within the canyon-like avenues of the Caille megalopolis that they are streaked through with neon colours at every hour of the day. This pattern is seen in many Gallente cities but Caille remains the most astonishing example in the Federation.    The Caille Neon nanocoating echoes and celebrates the glowing vibrancy of Federation streetlife, providing a striking livery option for pilots of Gallente ships."; marketGroupId= Some(1979); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
